
combination = """



"""

# keypad
# 1 2 3
# 4 5 6
# 7 8 9
keypad = [[1, 2, 3], 
          [4, 5, 6], 
          [7, 8, 9]]

# combination = """ULL
                # RRDDD
                # LURDL
                # UUUUD"""

combination = combination.split("\n")
combination = [row.strip() for row in combination]

current_position = [1, 1]

combination_list = []

for row in combination:
    print(row)
    for move in row:
        if move == "U":
            current_position[1] -= 1
            if current_position[1] < 0:
                current_position[1] = 0
        elif move == "D":
            current_position[1] += 1
            if current_position[1] > 2 :
                current_position[1] = 2
        elif move == "R":
            current_position[0] += 1
            if current_position[0] > 2:
                current_position[0] = 2
        else:  # move == 'L'
            current_position[0] -= 1
            if current_position[0] < 0:
                current_position[0] = 0
        print(current_position)
    combination_list.append(str(keypad[current_position[1]][current_position[0]]))
    print(combination_list)

print("".join(combination_list))



